import React from "react";

const Resume = ({ dataObj }) => {
  const { brand, year, membership } = dataObj;

  if (dataObj.brand === "" || dataObj.year === "" || dataObj.membership === "")
    return null;

  return <h2>Resume</h2>;
};

export default Resume;
